// src/components/Home.js
import React from "react";
import { Link } from "react-router-dom";
import Carousel from "react-bootstrap/Carousel";

function Home() {
  return (
    <div style={{ position: "relative" }}>
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="/images/slide1.jpg" // Thay bằng tên file slide chính
            alt="Celebration Ham Slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="/images/slide2.jpg" // Thay bằng tên file slide chính
            alt="Celebration Ham Slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="/images/slide3.jpg" // Thay bằng tên file slide chính
            alt="Celebration Ham Slide"
          />
        </Carousel.Item>
      </Carousel>

      {/* Hiển thị các hình tròn nhỏ từ menu */}
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          marginTop: "20px",
        }}
      >
        <img
          src="/images/menu-01.jpg" // Thay bằng tên file menu 1
          alt="Menu 1"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-02.jpg" // Thay bằng tên file menu 2
          alt="Menu 2"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-03.jpg" // Thay bằng tên file menu 3
          alt="Menu 3"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-04.jpg" // Thay bằng tên file menu 4
          alt="Menu 4"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-05.jpg" // Thay bằng tên file menu 5
          alt="Menu 5"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-06.jpg" // Thay bằng tên file menu 6
          alt="Menu 6"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-07.jpg" // Thay bằng tên file menu 6
          alt="Menu 6"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
        <img
          src="/images/menu-08.jpg" // Thay bằng tên file menu 6
          alt="Menu 6"
          style={{
            width: "80px",
            height: "80px",
            borderRadius: "50%",
            margin: "0 10px",
          }}
        />
      </div>
    </div>
  );
}

export default Home;
